import styled from "styled-components";
import React from "react";
import "../../../App.css";
import { Link } from "react-router-dom";
function InNavbar() {
  return (
    <Container>
      <logo>
        <h1>A. WorkSpace</h1>
      </logo>
      <Menu>
        <Link to="">InMail</Link>
        <Link to="">ClassRoom</Link>
        <Link to="">Meetings</Link>
        <Link to="">ChitChat</Link>
        <Link to="">Thoughts</Link>
      </Menu>
    </Container>
  );
}
export default InNavbar;

const Container = styled.nav`
  background-color: white;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  display: flex;
  align-items: center;
  height: 92px;
  top: 0;
  left: 0;
  right: 0;

  logo {
    color: blue;
    position: absolute;
    width: 17.68px;
    height: 24.88px;
    left: 21px;
    top: 28px;
    font-weight: 800;
  }
`;

const Menu = styled.div`
  display: flex;
  justify-content: center;
  //flex: 1;
  width: 590px;
  height: 39px;
  background-color: #6cb9ff;
  top: 26px;
  left: 500px;
  border-radius: 47px;

  a {
    color: black;
    font-size: 14px;
    font-weight: 700;
    left: 500px;
  }
`;
